     QScriptValue REcmaHatchEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RHatchEntity* self = getSelf("RHatchEntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RHatchEntity* REcmaHatchEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RHatchEntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RHatchEntity >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RHatchEntity.%1(): "
                        "This object is not a RHatchEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RHatchEntity* REcmaHatchEntity::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RHatchEntity* selfBase = getSelf(fName, context);
                RHatchEntity* self = dynamic_cast<RHatchEntity*>(selfBase);
                //return REcmaHelper::scriptValueTo<RHatchEntity >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RHatchEntity.%1(): "
                    "This object is not a RHatchEntity").arg(fName),
                    context);
            }

            return self;
            


        }
        